import './App.css';
import MyModal from './components/MyModal'
import MB from './components/MField'
import { ThemeProvider } from './components/ThemeProvider';


function App() {
  return (
  <ThemeProvider>
    <div className="App">
        <MB />
        <MyModal />
    </div>
    </ThemeProvider>
  );
}

export default App;
